package zork;import ch.bbw.zork.CommandWords;import org.junit.Test;import static org.junit.Assert.*;public class TestCommandWords {	CommandWords commandWords = new CommandWords();	@Test	public void testIsCommand(){		assertTrue(commandWords.isCommand("go"));		assertFalse(commandWords.isCommand("no"));	}	@Test	public void testShowAll(){		assertEquals("go quit help back", commandWords.showAll());	}}